-- ----------------------------
-- Procedure structure for `my_cj`
-- ----------------------------
DROP PROCEDURE IF EXISTS `my_cj`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `my_cj`(num char(8))
begin
select 学号,课程号,课程名,kc.学分,成绩,my_cj_one(num,课程名) as 排名
from cj
join kc
using(课程号)
where 学号=num;
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `all_cj_rank_one`
-- ----------------------------
DROP FUNCTION IF EXISTS `all_cj_rank_one`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `all_cj_rank_one`(subject char(8)) RETURNS int(11)
begin
return(
select 排名
from
(
select 学号,课程号,课程名,学分,成绩,排名
from (
select 学号,课程号,课程名,学分,成绩,@currank := @currank+1 as 排名
from 
(select 学号,课程号,kc.课程名,cj.学分,成绩
from cj
join kc
using(课程号)
where 课程名=subject
order by 成绩 desc) a
join (select @currank := 0 ) q
order by 成绩 desc) b
) c
);
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `my_cj_one`
-- ----------------------------
DROP FUNCTION IF EXISTS `my_cj_one`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `my_cj_one`(num char(8),subject char(8)) RETURNS int(11)
begin
return(
select 排名
from
(
select 学号,课程号,课程名,学分,成绩,排名
from (
select 学号,课程号,课程名,学分,成绩,@currank := @currank+1 as 排名
from 
(select 学号,课程号,kc.课程名,cj.学分,成绩
from cj
join kc
using(课程号)
where 课程名=subject
order by 成绩 desc) a
join (select @currank := 0 ) q
order by 成绩 desc) b
where 学号=num
) c
);
end
;;
DELIMITER ;
